import React from "react";

const Formulario = () => {
  return (
    <form
      className="col-12"
    >
      <fieldset className="text-center">
        <legend>Buscar bebidas por Categoria o Ingrediente</legend>
      </fieldset>
    </form>
  );
}

export default Formulario;
